import React, { Component } from "react";
import { TextField } from "@material-ui/core";

export default class Lgon extends Component {
  render() {
    return (
      <div>
        <h2>LOGIN</h2>
        <TextField
          id="outlined-dense"
          label="Dense"
          className={clsx(classes.textField, classes.dense)}
          margin="dense"
          variant="outlined"
        />
      </div>
    );
  }
}
